  false,\n\t\"url\": null,\n\t\"notes\": \"  Voting district is the generic name for
  geographic entities such as precincts, wards, and election districts established
  by Staten                                   governments for the purpose of conducting
  elections.  States participating in the 2010 Census Redistricting Data Program as
  part ofn                                   Public Law 94-171 (1975) provided the
  Census Bureau with boundaries, codes, and names for their VTDs.  Each VTD is identified
  by an                                   1- to 6-character alphanumeric census code
  that is unique within county.  For the 2010 Census, Rhode Island is the only State
  thatn                                   did not participate in Phase 2 (the Voting
  District Project) of the Redistricting Data Program and no VTDs exist for this State
  inn                                   the 2010 Census data products.  Note that
  only Montana and Oregon do not have complete coverage of VTDs for the 2010 Census.n
